import React from "react";
import Films from "./Films";
import Starships from "./Starships";
import Vehicles from "./Vehicles";

export default function Home(){
    return (
        <div className="Home">
            <Films/>
            <hr></hr>
            <Starships/>
            <hr></hr>
            <Vehicles/>
        </div>
    )
}
